import React, { FC, ReactElement} from "react";
import { Grid, GridItem } from '@chakra-ui/react'

import EntityList from "../../components/taskArea/taskArea";
import {Sidebar} from "../../components/sidebar/sidebar";
import { Entity } from "../../components/taskArea/taskArea";
interface Props {
    entities: Entity[];
}
export const Dashboard: FC<Props>  = ({ entities }) => {
    return (
        <Grid
            h='500px'
            templateColumns={'65% 35%'}
            gap={4}
        >
            <GridItem rowSpan={2} bg='papayawhip'>
                <EntityList  entities={entities}/>
            </GridItem>
            <GridItem rowSpan={2} bg='papayawhip' >
                <Sidebar/>
            </GridItem>

        </Grid>

    )
};
